INSERT INTO `games` (`game_id`, `game_title`, `game_image`, `game_description`, `game_price`, `game_console`) VALUES
(1, 'Minecraft', 'minecraft.jpg', 'Bouw werelden die alleen door je verbeelding worden beperkt. Verken, bouw en verover alleen of met je vrienden.', '26.99', 'PS4'),
(2, 'Grand Theft Auto: 5', 'gtaV.jpg', 'Te midden van deze onrust riskeren drie zeer verschillende criminelen alles in een reeks van gedurfde en gevaarlijke heists, die hen een leven zonder geldzorgen moeten bezorgen.', '17.99', 'PS4'),
(3, 'Rockstar: RDR 2', 'red2.jpg', 'Amerika, 1899. Wetshandhavers hebben het gemunt op de laatste outlaw-bendes. Wie zich niet wil overgeven, wordt genadeloos afgemaakt. ', '54.99', 'PS4'),
(4, 'EA: Fifa 19', 'fifa19.jpg', 'Speel het hoogtepunt van clubvoetbal in allerlei game modes in FIFA 19 met de officiÃ«le wedstrijden, een reeks verschillende toernooi-ervaringen waaronder UEFA Champions League, Europa League en Super Cup, en een gloednieuw commentaarteam met Derek Rae en Lee Dixon.', '44.99', 'X-BOX'),
(5, 'Call Of Duty: BO4', 'codbo4.jpg', 'Black Ops 4 legt de lat hoog voor de multiplayer-modus met tactische gameplay en keuze uit verschillende personages, samen met de drie Zombies ervaringen, het grootste aanbod dat ooit bij een lancering is uitgebracht.', '59.99', 'X-BOX'),
(6, 'Fortnite', 'Fortnite.jpg', 'De Storm kwam zonder waarschuwing. 98% van de wereldbevolking verdween... en toen kwamen de monsters. Commandeer de nog in leven zijnde helden aan en vecht om de Storm tegen te houden.', '60.00', 'PS4'),
(7, 'Just Cause 4', 'jc4.jpg', 'Welkom in SolÃ­s, een enorme Zuid-Amerikaanse wereld vol conflicten, onderdrukking en extreme weersomstandigheden. In Just Cause 4 belandt de slechte agent Rico Rodriguez in SolÃ­s om koste wat kost op zoek te gaan naar de waarheid over zijn verleden.', '59.99', 'X-BOX'),
(8, 'Lazer League', 'lazer.jpg', 'Verpletter de tegenstander in deze razendsnelle sport van de toekomst. Laser League biedt een compleet nieuwe multiplayerervaring â het is makkelijk te leren, maar heel moeilijk om mee te stoppen. ', '19.99', 'PS4'),
(9, 'Marvel: Spiderman', 'spiderman.jpg', 'Stap in het leven van een van de meest iconische superhelden ooit. Marvel\'s Spider-Man zit boordevol acrobatische kunstjes, improvisatie en alle spinnenweb-actie waar deze muurkruiper om bekendstaat.', '24.99', 'PS4'),
(10, 'Detroit: BH', 'detbh.jpg', 'Reis naar de metropool Detroit in de nabije toekomst, een stad die een verjongingsinjectie heeft gekregen door een spannende technologische ontwikkeling: androids.', '49.99', 'X-BOX'),
(11, 'Destiny: 2', 'dest2.jpg', 'Destiny 2 is een first-person actiespel en de evolutie van zijn bekroonde voorganger met een boeiend en indrukwekkend nieuw verhaal en een nieuw begin voor alle nieuwe, terugkerende, casual en hardcore spelers.', '39.99', 'X-BOX'),
(12, 'Fallout: 76', 'f76.png', 'Reclamation Day, 2102. 25 jaar nadat de bommen zijn gevallen ga jij en je mede Vault Dwellers, gekozen uit de beste en slimste van het land, op avontuur in het post-nucleaire Amerika.', '59.99', 'X-BOX'),
(13, 'Assassin\'s Creed', 'aco.jpg', 'Schrijf je eigen epische heldenverhaal en word een legendarische Griekse held in Assassinâs Creed Odyssey, een inspirerend avontuur waar jij het lot afdwingt en je je eigen pad bepaalt.', '49.99', 'PC'),
(14, 'Cuphead', 'cuph.png', 'Cuphead is een klassiek run & gun actiespel met een focus op indrukwekkende en uitgebreide baasgevechten. De visuele stijl van de game vond zijn oorsprong bij de Disney tekenfilms uit de jaren \'30. ', '19.99', 'PC'),
(15, 'Ark: Survival Evolved', 'arke.jpg', 'Bereid je voor op het ultieme dino-avontuur! Aangespoeld op een mysterieus prehistorisch eiland, moet je op verkenning doorheen de verschillende gebieden, terwijl je jaagt, oogst, werktuigen bouwt, voedsel teelt en een huis bouwt om te overleven.', '19.99', 'NS'),
(16, 'The Legend Of: Zelda', 'zelda.gif', 'In het nieuwste deel in de The Legend of Zelda-reeks verken je een gigantische wereld van weergaloos formaat. Link komt in deze reusachtige omgeving nieuwe puzzels en vijanden tegen. ', '19.99', 'NS'),
(17, 'Super Mario: Odsyssey', 'smo.jpg', 'Beleef samen met Mario een groots avontuur in 3D, waarin je een heuse wereldreis maakt. Gebruik Marios nieuwe moves om manen te verzamelen en je luchtschip van brandstof te voorzien.', '19.99', 'NS'),
(18, 'Mario Kart: 8', 'mk8.jpg', 'Scheur over blauwe antizwaartekrachtspanelen om het wegdek achter je te laten en via adembenemde watervallen, langs gevels en andere sluipwegen de finish te bereiken. Het weggedrag is trouwens anders in de antizwaartekrachtstand: ram andere deelnemers voor een botsboost en om snelheid te winnen!', '19.99', 'NS'),
(19, 'Super Mario Party', 'smp.png', 'De originele bordspelstijl heeft een schop onder de kont gekregen en bevat nu meer strategische elementen, zoals specifieke dobbelblokken voor elk personage. ', '19.99', 'NS'),
(20, 'Super Smash Bro\'s', 'ssb.jpg', 'Game-iconen gaan de strijd met elkaar aan in het ultieme gevecht dat je altijd, overal en met iedereen kunt spelen: Super Smash Bros. Ultimate voor de Nintendo Switch, de serie die al meer dan 40 miljoen keer is verkocht. ', '19.99', 'NS'),
(21, 'De Sims: 4', 'sims.jpg', 'Jij bouwt. Jij bepaalt. Jij heerst in De Sims 4. Uit je creativiteit en creÃ«er nieuwe Sims met opvallende karakters en unieke uiterlijke kenmerken.', '29.99', 'PC'),
(22, 'Battlefield: 5', 'bv.jpg', 'Stort je in het grootste conflict in de geschiedenis van de mensheid met Battlefield V en zie de serie terugkeren naar haar wortels in een ongekende weergave van de Tweede Wereldoorlog. ', '39.99', 'PC'),
(23, 'Planet Coaster', 'planet.jpg', 'Planet Coaster is een simulatiegame waarin je pretparken kan bouwen en uitbaten. De game is ontwikkeld en gepubliceerd door Frontier Developments, die eerder gewerkt hebben aan RollerCoaster Tycoon 3, waarvan Planet Coaster de spirituele opvolger is.', '29.99', 'PC'),
(24, 'Rocket League', 'rock.jpg', 'Voetbal en racen komen weer samen in het langverwachte multiplayer vervolg op Supersonic Acrobatic Rocket-Powered Battle-Cars! Kies uit veel hoogvliegende voertuigen met enorme raketboosters en zweef hoog in de lucht om waanzinnige luchtgoals te scoren, fantastische saves te leveren en zelfs vijandelijke spelers te slopen op ongelooflijke snelheden!', '19.99', 'PC');

